DROP SEQUENCE IF EXISTS price_quotes_id_seq;
CREATE SEQUENCE price_quotes_id_seq;

CREATE TABLE IF NOT EXISTS "price_quotes" (
    "pq_id" BIGINT NOT NULL DEFAULT nextval('price_quotes_id_seq'),
    "prd_id" BIGINT NOT NULL,
    "price" VARCHAR(64) NOT NULL,
    "created_at" TIMESTAMPTZ NOT NULL,
    PRIMARY KEY ("pq_id")
);
ALTER SEQUENCE price_quotes_id_seq
OWNED BY price_quotes.pq_id;

DELETE FROM "price_quotes";



SELECT setval('price_quotes_id_seq', (SELECT max(pq_id) FROM price_quotes));
